<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<style>

  @keyframes move-down {
      0% {
        transform: translateY(-40px); 
        opacity: 1;
      }

      100% {
        transform: translateY(160px); 
        opacity: 0;
      }
    }
  
    
    .keyframes-bullet1 {
      animation: move-down 1.5s forwards ; 
    }
  
    @keyframes move-up {
      0% {
        transform: translateY(60px); 
        opacity: 1;
      }
  
      100% {
        transform: translateY(-200px); 
        opacity: 0; 
      }
    }
  
  
   
    .keyframes-bullet2 {
      animation: move-up 1.5s forwards ; 
    }
  
    @keyframes explode {
      0% {
          transform: scale(1) translate(0, 0);
          opacity: 1;
      }
      100% {
          transform: scale(2) translateX(200px) translateY(-1500px);
          opacity: 0;
      }
  }
  
  
  @keyframes explode2 {
      0% {
          transform: scale(1) translate(0, 0);
          opacity: 1;
      }
      100% {
          transform: scale(2) translateX(-800px) translateY(150px); 
          opacity: 0;
      }
  }
  
  
  @keyframes explode3 {
      0% {
          transform: scale(1) translate(0, 0);
          opacity: 1;
      }
      100% {
          transform: scale(2) translateX(-400px) translateY(-360px); 
          opacity: 0;
      }
  }
  
  
  @keyframes explode4 {
      0% {
          transform: scale(1) translate(0, 0);
          opacity: 1;
      }
      100% {
          transform: scale(2) translateX(-400px) translateY(-1800px); 
          opacity: 0;
      }
  }
  
  
  
  
     
    .keyframes-letter .letter1 {
  
      animation: explode4 1s forwards ; 
      animation-delay: 1s;
    }
  
    .keyframes-letter .letter2 {
      animation: explode3 1s ease-out forwards ; 
      animation-delay: 1s;
  }
  
  .keyframes-letter .letter3 {
      animation: explode 1s ease-out forwards ; 
      animation-delay: 1s;
  }
  
  .keyframes-letter .letter4 {
      animation: explode2 1s ease-out forwards ;
      animation-delay: 1s;
  }
  
  .keyframes-letter .letter5 {
      animation: explode4 1s ease-out forwards ;
      animation-delay: 1s;
  }
  
  .keyframes-letter .letter6 {
      animation: explode 1s ease-out forwards ;
      animation-delay: 1s;
  }
  
  .keyframes-letter .letter7 {
      animation: explode2 1s ease-out forwards ;
      animation-delay: 1s;
  }
  
  .keyframes-letter .letter8 {
      animation: explode 1s ease-out forwards ;
      animation-delay: 1s;
  }
  
  .keyframes-letter .letter9 {
      animation: explode3 1s ease-out forwards ;
      animation-delay: 1s;
  }

</style>
